script: |
  super -f text -I q13307.spq | sort > q13307.out

inputs:
  - name: q13307.spq
    data: |
      SELECT - 50 FROM tab2 (FORMAT parquet) WHERE - col0 * + col1 NOT BETWEEN - col1 * - col1 * - 34 * - col1 AND - col1;
  - name: tab2

outputs:
  - name: q13307.out
    data: |
      -50
      -50
      -50
